export const database = {
    jobs: [
        [{ title: "World Chef" }, { description: "Five star Michelin only pls. No fan mail." }, { emergency: true }, { favorite: false }, { applied: false }],
        [{ title: "World Engineer" }, { description: "Top world builder only. No fan mail" }, { emergency: false }, { favorite: false }, { applied: false }],
        [{ title: "World AI Master" }, { description: "Must be able to train Tesla car. No fan mail" }, { emergency: true }, { favorite: true }, { applied: false }],
        [{ title: "World Hunter" }, { description: "Must have hunt a deer twice. No fan mail" }, { emergency: false }, { favorite: false }, { applied: false }],
        [{ title: "World Dealer" }, { description: "Must have wins against top blackjack player in the world. No fan mail" }, { emergency: false }, { favorite: false }, { applied: true }]
    ]
}
